                <div>
                <h3><img src={pic1} alt="pic1"/></h3>
                </div>
                <div>
                <h3><img src={pic2} alt="pic2"/></h3>
                </div>
                <div>
                <h3><img src={pic3} alt="pic3"/></h3>
                </div>
                <div>
                <h3><img src={pic4} alt="pic4"/></h3>
                </div>
            </Carousel>
            </>
        );
    }
}

export default Header;
